          "Dummy...you get to live...he's going to train you.Dragon Ball Z: Dead Zone Nicky (\u30cb\u30c3\u30ad\u30fc, Nikk\u012b) is one of Garlic Jr.'s original trio of henchmen in Dragon Ball Z: Dead Zone. Nicky is tall with white hair and blue skin. He sports a set of sharp fangs. Along with Ginger and Sansho, Nicky ambushes Piccolo when he is in the middle of training and seemingly kill him. The trio on Garlic Jr's orders next head to Goku's House in order to retrieve the Dragon Ball from Gohan but takes the boy as well. Afte",
