          "This article is about the Capsule Corporation Battle Guide from Dragon Ball Heroes. For the descendant of Barry Kahn from Dragon Ball Online, see Sora Kahn. Sora (\u30bd\u30e9, Sora) is a character in the Dragon Ball Heroes universe who acts as a Capsule Corporation battle guide. He is portrayed in real-life by the actor Kei Hamasaki (\u6d5c\u5d0e\u6075, Hamasaki Kei). In the spin-off manga Dragon Ball Heroes: Victory Mission, Sora works in an arcade in Satan City. Sora seems to know Beat well and tells him to try Galax",
