          "Directory: Characters \u2192 Villains \u2192 DBS villains \u2192 Movie villains Sorbet (\u30bd\u30eb\u30d9, Sorube) is a loyal subject of the emperor, Frieza. He is a member of Frieza's support staff in the Third Stellar Region. He later became the commander of the Frieza Force after Frieza's demise. Sorbet is the secondary antagonist of the Golden Frieza Saga. Sorbet is a short blue alien with a large black nose giving him an anthropomorphic koala like look. He wears a new type of Battle Armor which is colored green and bla",
